import React from "react";
import { useNavigate } from "react-router-dom";

import MyButton from "../components/MyButton";
import MyHeader from "./../components/MyHeader";

const New = () => {
    const navigate = useNavigate();
    return (
        <div className="New">
            <MyHeader
                headText={"새 일기 쓰기"}
                leftChild={
                    <MyButton
                        onClick={() => {
                            navigate(-1);
                        }}
                        text={"뒤로 가기"}
                    />
                }
            />
            <div>
                <section>
                    <h4>오늘은 언제인가요?</h4>
                    <div className="input-box">
                        <input type="date" />
                    </div>
                </section>
            </div>
        </div>
    );
};

export default New;
